INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5600380896283', 'Real Whey 100% whey Protein', 'Concentré de Protéine de LACTOSÉRUM (contient un Émulsifiant (Lécithine de SOJA)) (91 0%), Cacao, Arômes, Épaississants (Gomme de Guar, Gomme de Xan- thane), Édulcorants (Acésulfame K, Sucralose). Peut contenir des traces d\'œuf et de gluten. MODE D\'EMPLOI: Prendre 2 à 3 doses par jour. Pour préparer une portion, mélanger 25g (2 1/2 doseurs) à 250mL d\'eau froide ou de la boisson de votre choix. Varier la quan- tité de liquide pour obtenir le parfum et la consistance souhaitées. Pour un parfum intense, ajouter 225 à 250mL d\'eau. Pour un parfum plus doux, ajouter 300 à 350mL d\'eau. Bien agiter pendant environ S secondes. Pour une meilleure dissolution, utiliser de l\'eau à tem- pérature ambiante. Doseur à l\'intérieur du récipient. Ce produit ne doit pas remplacer une alimentation variée et équilibrée et un mode de vie sain. Conserver dans Itemballage d\'origine dans un endroit sec, à l\'abri de toute chaleur excessive, de l\'humidité et de la lumière directe du soleil.', 'https://static.openfoodfacts.org/images/products/560/038/089/6283/front_fr.4.400.jpg', '7.6', '1.4', '6.7', '3', '', '76', '0.28', '0.110236220472441', '', '1');

